description:
Street Life

Sociopolitical Documentary hosted by Zhao Dayong, published by Lantern Films in 2006 - Chinese narration


Information
------------------------------

Zhao Dayong's Street Life documents the lives of Chinese migrants in Shanghai, one of the world's largest and most vibrant cities, now symbolic of China's economic might. The film centers on Nanjing Road, one of China's oldest commercial streets and today a popular destination for tourists and moneyed Chinese. The street has also become a Mecca for uprooted and homeless Chinese, who make ends by collecting garbage and recyclables.
Also known as &quot;Living on Nanjing Road&quot;.

